import { NgModule } from '@angular/core';
import { RouterModule } from '@angular/router';

@NgModule({
  imports: [
    RouterModule.forChild([
      {
        path: 'parameter',
        data: { pageTitle: 'nspay2App.administration.parameter.home.title' },
        loadChildren: () => import('./parameter/parameter.module').then(m => m.ParameterModule),
      },
      {
        path: 'payroll-black-out',
        data: { pageTitle: 'nspay2App.administration.payroll-black-out.home.title', tab: 0 },
        loadChildren: () => import('./black-out-date/black-out-date.module').then(m => m.BlackOutDateModule),
      },
      {
        path: 'public-holiday',
        data: { pageTitle: 'nspay2App.administration.public-holiday.home.title' , tab: 1},
        loadChildren: () => import('./black-out-date/black-out-date.module').then(m => m.BlackOutDateModule),
      },
      {
        path: 'employer-profile',
        data: { pageTitle: 'nspay2App.administration.employer-profile.home.title' , tab: 1},
        loadChildren: () => import('./employer-profile/employer-profile.module').then(m => m.EmployerProfileModule),
      },
      {
        path: 'approval',
        data: { pageTitle: 'nspay2App.administration.admin-approval.home.title'},
        loadChildren: () => import('./admin-approval/admin-approval.module').then(m => m.AdminApprovalModule),
      }
    ]),
  ],
})
export class AdministrationRoutingModule {}
